message:
Брифинг Минобороны РФ:

▪️Выход украинских подразделений к Азовскому морю полностью заблокирован;
▪️Передовые отряды ДНР вышли на границу Донецкой области и соединились с российскими силами, которые брали под контроль районы вдоль побережья;
▪️Российские войска сегодня нанесли удар высокоточным оружием большой дальности воздушного и морского базирования, поражены два аэродрома и три радиолокационных поста ПВО, удары исключали поражение гражданской инфраструктуры и жилых домов.
▪️Уничтожено 395 танков и других боевых бронемашин, 59 реактивных систем залпового огня, 179 орудий полевой артиллерии и минометов украинских военных.

Брифинг Пескова:

▪️ пресс-секретарь Путина не располагает данными о потерях Вооруженных сил РФ в Украине;
▪️ Кремль не может иметь никакого отношения к потенциальным выборам на Украине;
▪️ Войска РФ на Украине не осуществляют ударов по жилым комплексам, это исключено;
▪️ Кремль продолжает считать Зеленского легитимным президентом Украины;
▪️ Разговор Путина с Зеленским пока не планируется;
▪️ Подача Украиной заявки на вступление в Евросоюз «лежит в другой плоскости», потому что ЕС — это не военно-политический блок [в отличие от НАТО], стремление Киева вступить в ЕС зафиксировано в Конституции Украины;
▪️ Санкции никак не повлияют на действия российских властей;
▪️ Манера США вводить санкции «как бацилла» распространилась на ЕС;
▪️ Агрессивные заявления против России сейчас носят «ультраконцентрированный характер».

Несколько заявлений Лаврова на конференции ООН по разоружению:

▪️ Для РФ неприемлемо, что на территории ряда европейских стран находится американское ядерное оружие, его давно пора вернуть в США;
▪️ Необходимо вернуть военные потенциалы, в том числе ударные, и инфраструктуру НАТО к состоянию на 1997 год, когда был заключен основополагающий акт Россия-НАТО. Для нас достижение этих целей имеет принципиальное значение;
▪️ Западным странам необходимо отказаться от создания военных объектов на территории государств, ранее входивших в СССР и не являющихся членами альянса, включая использование их инфраструктуры для ведения любой военной деятельности;
▪️ Власти в Киеве, затеявшие планы по обретению собственного ядерного оружия, угрожают международной безопасности. Россия не может не реагировать на реальную опасность обретения Украиной ядерного оружия и принимает все меры для недопущения этого;
▪️ Трагедия Украины - результат попустительства западных покровителей образовавшегося там преступного режима;
▪️ Угроза новой гонки вооружений и превращения космоса в арену вооруженного конфликта обретает реальные черты;
▪️ Для РФ достижение юридически обязывающих гарантий безопасности от стран НАТО имеет принципиальное значение;
▪️ РФ рассчитывает на успех переговоров по иранской ядерной сделке, альтернативы ей не существует.

Несколько заявлений Шойгу:

▪️ «Российская армия продолжит специальную военную операцию на Украине вплоть до достижения поставленных целей. Защита России от военной угрозы со стороны Запада является главной задачей специальной операции на Украине»;
▪️ «Российская армия не оккупирует украинскую территорию, принимает все меры для сохранения жизни и безопасности мирных жителей»;
▪️ «Украинская сторона не гнушается использовать мирных граждан в качестве живого щита. Реактивные системы залпового огня, орудия, крупнокалиберные миномёты размещаются во дворах жилых домов, вблизи школ и детских садов»;
▪️ «Удары наносятся только по военным объектам и исключительно высокоточным оружием»

Война в Украине. Главное за ночь:

▪️ Служба спецсвязи Украины сообщила, что российские войска начали штурм Херсона; 
▪️ Главный прокурор Международного уголовного суда в Гааге заявил, что готов начать расследование по войне в Украине;
▪️ Walt Disney Company приостанавливает показ своих фильмов в российских кинотеатрах. Также об этом объявили Sony Pictures и Warner Bros;
▪️ Компания Netflix не будет выполнять требование российских властей об обязательной трансляции 20 каналов первого и второго мультиплекса;
▪️ Япония ввела санкции против российского руководства, финансовых организаций, компаний и госструктур. Подробнее;
▪️ Канада первой в мире ввела запрет на импорт российской нефти;
▪️ Платёжная система Mastercard объявила об отключении ряда российских финансовых учреждений из-за нападения России на Украину;
▪️ РКН заблокировал сайт Тайга.инфо за освещение войны в Украине. Также надзорный орган заставил агентство ТВ2 удалить материал о войне.
▪️ Компания Harley-Davidson приостановила свою деятельность в России, пишет Bloomberg. Ранее об этом сообщили General Motors, Volkswagen, Volvo, Daimler Truck и Scania.

Война в Украине. Главное за сутки: 

▪️ В Гомеле прошли российско-украинские переговоры. Особо ни о чем не договорились. Через несколько дней попробуют еще;
▪️ Евросоюз ввел новые санкции против российских бизнесменов, чиновников и пропагандистов. Под персональные санкции попали Песков, Сечин, Усманов, Фридман, Скобеева, Красовский — полный список тут; 
▪️  США ввели санкции против Банка России, российского Минфина и Фонда национального благосостояния;
▪️ Дед подписал указ о контрсанкциях. Российским резидентам запретили переводить за рубеж валюту по договорам займа и зачислять валюту на свои счета за пределами России, а российские экспортеры теперь обязаны продавать 80% валютной выручки;
▪️ Росавиация закрыла воздушное пространство России для 36 государств, включая страны ЕС;
▪️ Доллар и евро на Мосбирже поднимались до 110 и 126 рублей, обновив исторические максимумы;
▪️ Из-за этого ЦБ поднял ключевую ставку с 9,5 до 20% и временно отменил торги акциями на Мосбирже;
▪️ Зеленский подал заявку на вступление Украины в Евросоюз. Президенты восьми стран ЕС заявили, что поддерживают эту инициативу;
▪️ FIFA и UEFA отстранили сборную России от участия во всех турнирах. Совет Международной федерации хоккея отстранил сборные России и Белоруссии от участия в международных матчах на неопределенный срок. НХЛ объявила о приостановке деловых отношений с РФ;
▪️ Мобильные операторы Украины запретили звонки с российских сим-карт на территории страны;
▪️ Турция заявила, что на основании конвенции Монтре не будет пропускать военные корабли через Босфор и Дарданеллы.

Зеленский опубликовал новое видеообращение. Тут главное: 

▪️ По словам Зеленского, за пять дней по Украине нанесли 56 ракетных ударов, было выпущено 113 крылатых ракет;
▪️ На переговорах с РФ «пока нет результата», который хотела бы получить Украина;
▪️ Заявление о вступлении Украины в ЕС отправлено в Брюссель и официально зарегистрировано; 
▪️ Также Зеленский призвал рассмотреть полное закрытие неба для российских ракет, самолетов, вертолетов, а также закрыть России доступ к аэропортам, портам и каналам по всему миру.

Главное из брифинга постпреда РФ при ООН Василия Небензи: 

▪️ У России была достоверная информация о подготовке нападения Киева на Донбасс;
▪️ США объявили 12 сотрудников постпредства РФ при ООН персонами нон грата;
▪️ Реальная власть в Украине — не Зеленский, а радикалы. Зеленский показал, что он слаб и не может им сопротивляться;
▪️ Заявление Киева о готовности к "демилитаризации" и "денацификации" будет шагом к окончанию войны;
▪️Россия закончит военные действия только тогда, когда Киев будет готов к "демилитаризации".

Вечерний брифинг Минобороны РФ. Главное:

▪️ Вооруженные силы РФ вывели из строя 1146 объектов военной инфраструктуры Украины, а также 311 танков и бронемашин, 42 самолета и вертолета, 51 реактивную систему залпового огня, 147 орудий полевой артиллерии и минометов;
▪️Российская авиация уничтожила 6 колонн бронетехники ВСУ;
▪️За сутки 110 украинских военных добровольно сложили оружие.

Инфы об убитых российских солдатах по-прежнему нет.

Постпред РФ при ООН Небензя: 

▪️оккупация Украины в планы России не входит, в планах - только демилитаризация;
▪️действия России на Украине перевираются и передергиваются;
▪️военная операция на Украине — это реализация права России на самооборону после заявлений Киева по ядерной тематике;
▪️для России вступление Украины в НАТО — «красная линия»;
▪️украинская власть, которую в последнее время активно вооружали и подзуживали ряд государств, пребывала в заблуждении о том, что с благословения западных кураторов они могут добиться военного решения проблемы Донбасса.

Полный список заявлений МИД Великобритании:


▪️Лондон призывает Москву обеспечить гуманитарный доступ в Украине и коридоры для беженцев;
▪️Сделаны первые шаги к полному отключению РФ от SWIFT;
▪️Активы ВТБ, Совкомбанка, Внешэкономбанка заморожены. Готовятся санкции против Сбербанка;
▪️Недвижимость и яхты российских олигархов могут быть в скором времени арестованы;
▪️ Глава Минтранса попросил порты не предоставлять доступ никаким судам под российским флагом;
▪️ Гражданам Великобритании не рекомендуется совершать поездки в Россию из-за проблем с авиасообщением и волатильностью экономики

Путин подписал указ о специальных экономических мерах в связи с «недружественными действиями Запада». Главное соберем в этот пост: 

▪️Российские экспортеры должны продавать 80% валютной выручки, зачисленной с 1 января 2022;
▪️ Путин запретил российским резидентам предоставлять иностранные займы в валюте;
▪️Также российским резидентам запретят зачислять валюту на счета в банках за пределами РФ.

Набиуллина:

▪️Банки не могут изменять условия по выданным и фиксированным кредитам;
▪️Экономические условия в России поменялись кардинально, санкции ограничили возможность использования золотовалютных резервов ЦБ;
▪️Карты международных платежных систем продолжают работать внутри России;
▪️Банк России смягчит выдачу ипотеки и необеспеченных потребительских кредитов;
▪️Российская Система передачи финансовых сообщений сможет заменить SWIFT;
▪️Клиенты банков тоже не забыты: ЦБ рекомендует не штрафовать за просроченные выплаты, готов помогать с реструктуризацией кредитов.

Новый брифинг Минобороны РФ.

▪️ российская авиация завоевала господство в воздухе над всей территорией Украины;
▪️ взяты под контроль Бердянск и Энергодар, полностью охраняют и контролируют территорию вокруг Запорожской АЭС. Радиоактивный фон в норме;
▪️ все находящиеся в Киеве мирные жители могут беспрепятственно покинуть город по трассе Киев – Васильков. «Данное направление открыто и безопасно»;
▪️ с начала операции вооруженными силами РФ уничтожены 1 114 объектов военной инфраструктуры Украины;
▪️ ну и разумеется: в Киеве банды мародёров, грабителей и националистов.

Банк России объявил меры по поддержке кредитных организаций.

▪️ рекомендовал банкам реструктурировать долг, не назначать пени и штрафы, если финансовое положение заемщика ухудшилось из-за санкций;
▪️ разрешил банкам не увеличивать резервы по кредиту, если финансовое положение заемщика ухудшилось из-за санкций.

Еще из обращения Зеленского: 

▪️Мы с Лукашенко не разговаривали два года, но в этот раз разговор был очень детальным; 
▪️Лукашенко заверил меня, что войска из Белоруссии в Украину не пойдут и пообещал не поставлять оружие в страну; 
▪️Вчера мы потеряли "Мрию"

Мэр Киева Кличко рассказал о ситуации в городе: 

▪️Киев держит оборону, российских войск в столице нет;
▪️Ночью были столкновения и перестрелки с диверсионными группами;
▪️С начала боевых действий погибли 9 мирных жителей, 18 военных и бойцов территориальной обороны, а также 4 неопознанных человека;
▪️ Пострадали 106 человек, из них 47 гражданских;
▪️В Киеве до завтрашнего утра действует комендантский час

Первое заявление ЦБ после новых санкций: 

▪Банк России располагает необходимыми ресурсами и инструментами для поддержания финансовой стабильности и обеспечения операционной непрерывности финансового сектора;
▪ЦБ будет непрерывно предоставлять банкам наличную и безналичную ликвидность в рублях;
▪Передачу финансовых сообщений внутри страны при любом сценарии развития событий [отключение SWIFT] обеспечивает Система передачи финансовых сообщений (СПФС) Банка России;
▪Российская банковская система стабильна, имеет достаточный запас капитала и ликвидности для бесперебойного функционирования в любой ситуации. Все средства клиентов на счетах сохранены и доступны в любой момент времени.

Песков ответил на заявления Зеленского по переговорам: 

▪Гомель как место переговоров был выбран Киевом;
▪Москва предупредила Киев, что на этот раз «мероприятия, предусмотренные ходом военной операции, приостанавливаться в связи с переговорами не будут»;
▪Российскую делегацию на переговорах с Украиной возглавляет помощник деда Мединский.

Лукашенко выступил с заявлением: 

▪на Украине нет ни белорусских солдат, ни вооружения, ни боеприпасов, России и не нужна такая помощь;
▪Надо прекратить войну. Я бы даже не назвал это войной. Это конфликт. День-два - будет война. А через три дня - мясорубка;
▪в Белоруссию с Украины привозили оружие, готовили там бандформирования для провокаций в республике;
▪конфликт на Украине - цветочки, если продолжит развиваться, будут ягодки;
▪До сих пор Киев никто не бомбил.

Новая сводка Минобороны РФ

▪За прошедшие сутки Вооруженные силы блокировали Херсон и Бердянск, взяты под контроль Геническ и аэродром Чернобаевка под Херсоном;
▪302-й зенитный ракетный полк ВСУ добровольно сложил оружие и сдался. Задержан 471 украинский военнослужащий;
ВС РФ уничтожили 975 объектов военной инфраструктуры Украины, среди них 23 пункта управления, 31 зенитный ракетный комплекс ПВО С-300;
 Среди них: 23 пункта управления и узлы связи ВСУ, 3 радиолокационных поста, 31 зенитный ракетный комплекс ПВО С-300, «Бук М-1» и «Оса», 48 радиолокационных станций
▪Сбиты: 8 боевых самолетов и 7 вертолетов, 11 беспилотных летательных аппаратов, две тактические ракеты «Точка-У»;
▪Уничтожено 223 танка и боевые бронированные машины, 28 самолетов (на земле), 39 реактивных систем, 86 орудий полевой артиллерии, 143 автомобильной техники;
▪ЛНР при огневой поддержке российских ВС установили контроль над населенными пунктами Новоахтырка, Смоляниново, Станично-Луганское.
▪Армия ДНР взяла под контроль Павлополь и Пищевик;

Война на Украине. День третий:

▪️Украина сообщила о гибели более 3500 российских военных за три дня войны;
▪️Киевское метро прекратило работу и перешло в режим укрытия;
▪️Харьков подвергся ожесточенному обстрелу, мощнейшему за три дня войны. Есть погибшие среди мирного населения;
▪️Запад сообщил о новых санкциях против России. Основное:
- ЕС заморозит активы Центробанка России, это может привести к девальвации рубля;
- некоторые российские банки отключат от SWIFT. В этот список не войдут банки, через которые идут платежи за энергоносители;
- ЕС планирует запретить российским олигархам использовать финансовые активы на рынках;
- ЕС отменит «золотые паспорта» для россиян;
▪️РКН потребовал удалить материалы в ряде СМИ из-за того, что они называют происходящее в Украине войной, а не «военной операцией»;
▪️Медведев заявил, что санкции ничего не изменят, а «приостановка членства России в Совете Европы — хорошая возможность восстановить ряд важных институтов для предотвращения особо тяжких преступлений в стране — типа смертной казни для опаснейших преступников»;
