▪️ Единичные случаи заражения коронавирусом выявлены среди эвакуированных из Донбасса, заселённых в пункты временного размещения в Ростовской области, сообщили в правительстве региона. «Для лиц с лёгким и средним течением заболевания подготовлены обсерваторы, пациенты с тяжелым течением болезни будут доставляться в ковидные госпитали региона», — говорится в сообщении;
▪️ В Ростовской области началась вакцинация среди эвакуированных жителей Донбасса. Об этом сообщил заместитель министра региональной политики и массовых коммуникаций Ростовской области Сергей Тюрин. «Вакцинация по желанию граждан предлагается. Вакцина в достаточном количестве, как и ПЦР-тесты. Весь комплекс мероприятий, необходимый по санэпидзащите, выполняется», — заявил чиновник;
▪️ Королева Великобритании Елизавета II заразилась коронавирусом, но надеется, что сможет исполнять необременительные обязанности на следующей неделе. Об этом говорится в сообщении, распространенном Букингемским дворцом;
▪️ В Перу более 40% детей от пяти до 11 лет сделали как минимум одну прививку от коронавируса. Об этом сообщил глава одного из департаментов министерства здравоохранения страны Алексис Ольгин.
